        'Bamban, Tarlac',
        'Tarlac',
        '2317',
        'From Aspiring IT Student to IT Professional',
        'Christian Paul D. Dayag is a 23-year-old IT student at Mabalacat City College (MCC) who is passionate about pursuing a career in the IT industry. Growing up, Christian had a keen interest in technology and was always curious about how things worked. As a result, Christian decided to pursue a degree in IT to learn more about this exciting field.\n\nThroughout Christian\'s academic journey, He has developed a range of skills, including web development, graphic design using tools such as Photoshop and Canva, and voice-over work. Christian is also fluent in English. He has experience being ESL Teacher for over four years at Nativecamp Company, which has helped Him to communicate effectively with clients and colleagues from all around the world.\n\nIn His free time, Christian enjoys playing the guitar and drums, playing games, and basketball. He finds that these hobbies help Him to relax and unwind after a busy day of studying or working on projects.\n\nLooking ahead, Christian is excited about the opportunities that the IT industry holds and is determined to work hard to become a successful IT professional. He is eager to use His skills and knowledge to make a positive impact on the world and help to create innovative solutions that can benefit society as a whole.',
        'Christian is a driven and focused individual, with a passion for both personal and professional growth. As a good listener, he is empathetic and attentive to others\' perspectives, making him an excellent friend and colleague.\n\nAs an enthusiast, Christian approaches life with a sense of excitement and wonder, always eager to learn new things and take on new challenges. He is a strong believer in the importance of family and maintaining a healthy work-life balance and actively strives to achieve this balance in his own life.\n\nChristian is a natural opportunity seeker, always on the lookout for new ways to grow and develop both personally and professionally. He has a strong entrepreneurial spirit and a keen sense of business acumen, making him a valuable asset to any team.\n\nHowever, Christian can sometimes be quiet and reserved and may need more time to feel comfortable expressing his thoughts and ideas. He may also struggle with procrastination and occasional clumsiness, but takes these setbacks in stride and works to learn from his mistakes.\n\nDespite occasional tendencies towards clinginess, Christian values his independence and is always striving to be the best version of himself.',
        'Bachelor of Science in Information Technology',
        '2023-03-30',
        'Bachelor of Science in Information Technology (BSIT) is an undergraduate program that focuses on the application of computing technologies to solve problems in different fields. The program is designed to provide students with a solid foundation in both the theoretical and practical aspects of information technology, including software development, database management, network administration, and web development.\n\nIn a BSIT program, students will learn about the different programming languages, algorithms, and data structures, as well as system analysis and design methodologies. The curriculum also covers essential topics such as computer architecture, operating systems, and computer networks.\n\nThroughout the program, students will also develop problem-solving and critical thinking skills that are necessary to succeed in the field of information technology. They will be exposed to various real-world applications of technology and will be required to apply their knowledge and skills to solve complex problems.\n\nGraduates of a BSIT program are well-equipped to pursue various careers in the field of technology, including software developers, network administrators, web developers, and IT project managers. They are also well-prepared to continue their education and pursue advanced degrees in computer science, information technology, or related fields.',
